import React, { Component } from 'react';

class Like extends Component {
  render() {
    return (
      <div>
        <i
          class="fa fa-heart-o"
          aria-hidden="true"
          onClick={this.handleLike}
        ></i>
      </div>
    );
  }
}

export default Like;
